function Item({name, type}) {
    const imagePath = process.env.PUBLIC_URL+"/assets/" + type + "/" + name +".png" ;
    console.log(imagePath);


    return (
        <div className="Item" >
            <img src={imagePath} alt={name} />
        </div>
    )
}

